  id,
  date,
  name,
  category,
  producer,
  productionArea,
}) {
  return (
    <Root>
      <date>{date}</date>

      <Link href={`/stock/${id}`}>
        <a>
          <WineBottleImage src="./wineBottleIcon.svg" alt="ワインボトル" />
        </a>
      </Link>

      <Attributes>
        <p>{name}</p>
        <p>{category}</p>
        <p>{producer}</p>
        <p>{productionArea}</p>
      </Attributes>
    </Root>
  );
}

List.getInitialProps = async () => {
